import MainContent from './componenst/MainContent';
import data from './componenst/data';
import './App.css';


function App() {

  const sisu = data.map(item => {
    return (
      <div>
        <h1> {item.name}</h1>
        <h1> {item.age}</h1>
        {item.img.map((img, index) => (
          <img key={item.id} src={img} alt={`${item.name}-${index}`} />
        ))
        }
      </div>


    );
  });
  const sisu2 = data.map(it => {
    return (
      <MainContent
        key={it.name}
        name={it.name}
        age={it.age}
        img={it.img}
        open={it.open}
      />
    )
  })


  return (
    <div className="App">
      {sisu}
      {sisu2}

    </div>
  );
}

export default App;
